import React from 'react'
import Hero from '../components/Hero';
import ListingCards from '../components/ListingCards';
import { motion } from 'framer-motion';

const Listings = () => {
    return (
        <motion.div
        inital={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        exit={{ opacity: 0 }}
        >
            <Hero />
            <ListingCards />
        </motion.div>
    )
}

export default Listings
